#include <cstring> 
#include <cmath> 
#include <algorithm> 
#include <string> 
#include <vector> 
#include <iostream> 
 
using namespace std; 
 
class Chessboard 
{  
  public:  
  string changeNotation(string cell)  
  { 
    if (cell[0] >= '0' && cell[0] <= '9') { 
      int a; 
      sscanf(cell.c_str(), "%d", &a); 
      --a; 
      return (string)"" + (char)('a' + a%8) + (char)(49 + a / 8); 
    } 
    char a[10]; 
    sprintf(a, "%d", cell[0] - 'a' + (cell[1] - '1')*8 + 1); 
    return a; 
  } 
   
  
};  
 
 
 
